window.bookSummaryJSON = "<p><b>The Academy is falling apart and I may be one of the only people who can hold it together. </b></p> <p>Surviving Freshman and Sophomore years at the Supernatural Academy was one of the hardest things I’ve ever had to do. But now, an even harder task awaits....</p> <p>....staying away from Rowan Underwood. </p> <p>He’s made his choice, going with the very people responsible for every evil that’s befallen us over the last two years. I’m over him. Or, at least that’s what I tell myself. </p> <p>But I’ve got other things to worry about. Mainly, how to keep the Academy together while gnomes run rampant, foes attack, and the leadership struggles just to keep order. </p> <p>The question is can I keep it all together without losing myself in the process?</p> <p><b>You will love the continuation of this magical academy series with kick-ass action, hot romance, and earth-shattering magic that will make you tingle in all the right places.</b></p> <p><b>Get it now. </b></p>"; 
